import React from "react";
import { Navbar, Row, Col, Container } from "react-bootstrap";

const Footer = () => {
  return (
    <Navbar sticky="bottom" className="bg-light">
      <Container>
        <Row>
          <Col>1 of 2</Col>
          <Col>2 of 2</Col>
        </Row>
        <Row>
          <Col>1 of 3</Col>
          <Col>2 of 3</Col>
          <Col>3 of 3</Col>
        </Row>
      </Container>
    </Navbar>
  );
};

export default Footer;
